class Contact {    private String name;    private String lastName;    private String phoneNumber;    private String email;    Contact(String name,            String lastName,            String phoneNumber,            String email) {        this.name = name;        this.lastName = lastName;        this.phoneNumber = phoneNumber;        this.email = email;    }    public String getName() {        return name;    }    public String getLastName() {        return lastName;    }    public String getPhoneNumber() {        return phoneNumber;    }    public String getEmail() {        return email;    }    public void setName(String name) {        this.name = name;    }    public void setLastName(String lastName) {        this.lastName = lastName;    }    public void setPhoneNumber(String phoneNumber) {        this.phoneNumber = phoneNumber;    }    public void setEmail(String email) {        this.email = email;    }    @Override    public boolean equals(Object o) {        if (this == o) return true;        if (o == null || getClass() != o.getClass()) return false;        Contact contact = (Contact) o;        if (getName() != null ? !getName().equals(contact.getName()) : contact.getName() != null) return false;        if (getLastName() != null ? !getLastName().equals(contact.getLastName()) : contact.getLastName() != null)            return false;        if (getPhoneNumber() != null ? !getPhoneNumber().equals(contact.getPhoneNumber()) : contact.getPhoneNumber() != null)            return false;        return getEmail() != null ? getEmail().equals(contact.getEmail()) : contact.getEmail() == null;    }    @Override    public int hashCode() {        int result = getName() != null ? getName().hashCode() : 0;        result = 31 * result + (getLastName() != null ? getLastName().hashCode() : 0);        result = 31 * result + (getPhoneNumber() != null ? getPhoneNumber().hashCode() : 0);        result = 31 * result + (getEmail() != null ? getEmail().hashCode() : 0);        return result;    }}